uniform float iTime;
uniform vec2 iResolution;
uniform vec4 iMouse;
uniform sampler2D iChannel0;

// Uniforms from JSON
uniform float u_speed;
uniform float u_wave_height;
uniform float u_portal_glow;
uniform float u_portal_size;
uniform float u_complexity;
uniform float u_mist_density;

out vec4 fragColor;

#define MAX_STEPS 100
#define SURF_DIST 0.005
#define MAX_DIST 50.0

// Helper: Rotation Matrix
mat2 rot(float a) {
    float s = sin(a), c = cos(a);
    return mat2(c, -s, s, c);
}

// 3D Hash
float hash(vec3 p) {
    p = fract(p * 0.3183099 + 0.1);
    p *= 17.0;
    return fract(p.x * p.y * p.z * (p.x + p.y + p.z));
}

// Simple Noise for the misty land
float noise(vec3 x) {
    vec3 i = floor(x);
    vec3 f = fract(x);
    f = f * f * (3.0 - 2.0 * f);
    return mix(mix(mix(hash(i + vec3(0, 0, 0)), hash(i + vec3(1, 0, 0)), f.x),
                   mix(hash(i + vec3(0, 1, 0)), hash(i + vec3(1, 1, 0)), f.x), f.y),
               mix(mix(hash(i + vec3(0, 0, 1)), hash(i + vec3(1, 0, 1)), f.x),
                   mix(hash(i + vec3(0, 1, 1)), hash(i + vec3(1, 1, 1)), f.x), f.y), f.z);
}

// SDF: Torus (for portal frame)
float sdTorus(vec3 p, vec2 t) {
    vec2 q = vec2(length(p.xy) - t.x, p.z);
    return length(q) - t.y;
}

// SDF: Inner Portal Fractal Geometry
float sdInside(vec3 p) {
    p.z += iTime * u_speed * 0.5;
    float d = 1e10;
    float s = 1.0;
    for(int i = 0; i < 4; i++) {
        p = abs(p) - 0.5;
        p.xy *= rot(0.5 + float(i));
        p.yz *= rot(0.3);
        float dist = (length(p.xy) - 0.1 * s);
        d = min(d, dist);
        s *= 0.8;
    }
    return d;
}

// Global scene map
// returns vec2(distance, ID) - ID 0: land, 1: portal frame, 2: portal interior
vec2 map(vec3 p) {
    float time = iTime * u_speed;

    // 1. Misty Wavy Land
    float landNoise = noise(p * 0.5 + vec3(0.0, 0.0, -time * 0.2));
    float land = p.y + 2.0 + landNoise * u_wave_height;
    vec2 res = vec2(land * 0.7, 0.0);

    // 2. Portal Frame
    vec3 portalP = p - vec3(0.0, 0.5, 0.0);
    float portalFrame = sdTorus(portalP.xzy, vec2(u_portal_size, 0.08));
    if (portalFrame < res.x) res = vec2(portalFrame, 1.0);

    // 3. Portal Interior (Clip to disk)
    float disk = length(portalP.xy) - u_portal_size;
    if (disk < 0.0 && abs(portalP.z) < 0.1) {
        float inside = sdInside(portalP * 1.5);
        if (inside < res.x) res = vec2(inside, 2.0);
    } else {
        // Pseudo-distance to disk to help the raymarching find the edge
        float diskEdge = max(disk, abs(portalP.z) - 0.01);
        if (diskEdge < res.x) res = vec2(diskEdge, 2.0);
    }

    return res;
}

// Standard Normal calculation
vec3 getNormal(vec3 p) {
    vec2 e = vec2(0.01, 0.0);
    return normalize(vec3(
        map(p + e.xyy).x - map(p - e.xyy).x,
        map(p + e.yxy).x - map(p - e.yxy).x,
        map(p + e.yyx).x - map(p - e.yyx).x
    ));
}

void main() {
    // 1. Setup Camera and UVs
    vec2 uv = (gl_FragCoord.xy - 0.5 * iResolution.xy) / iResolution.y;
    vec2 m = iMouse.xy / iResolution.xy;

    float time = iTime * u_speed;
    vec3 ro = vec3(0.0, 0.5, -7.0); // Ray Origin
    ro.yz *= rot(-m.y * 0.5 + 0.2);
    ro.xz *= rot(m.x * 2.0 - 1.0 + sin(time * 0.1) * 0.2);

    vec3 ta = vec3(0.0, 0.0, 0.0); // Target
    vec3 f = normalize(ta - ro);
    vec3 r = normalize(cross(vec3(0, 1, 0), f));
    vec3 u = cross(f, r);
    vec3 rd = normalize(f * 1.2 + uv.x * r + uv.y * u);

    // 2. Raymarching Loop
    float dO = 0.0;
    vec2 res;
    vec3 p;
    float glow = 0.0;

    for(int i = 0; i < MAX_STEPS; i++) {
        p = ro + rd * dO;
        res = map(p);

        // Portal Glow accumulation
        float distToFrame = length(p - vec3(0.0, 0.5, 0.0)) - u_portal_size;
        glow += 0.05 / (0.1 + abs(distToFrame) * 2.0);

        if(res.x < SURF_DIST || dO > MAX_DIST) break;
        dO += res.x;
    }

    // 3. Coloring
    vec3 col = vec3(0.0);

    // Background / Sky
    vec3 sky = mix(vec3(0.02, 0.01, 0.05), vec3(0.1, 0.05, 0.2), rd.y + 0.5);
    col = sky;

    if(dO < MAX_DIST) {
        vec3 n = getNormal(p);
        vec3 lightPos = vec3(2.0, 5.0, -3.0);
        vec3 l = normalize(lightPos - p);
        float diff = max(dot(n, l), 0.0);
        float spec = pow(max(dot(reflect(-l, n), -rd), 0.0), 32.0);

        if(res.y == 0.0) { // Land
            col = vec3(0.1, 0.12, 0.15) * diff;
            // Add some wave highlights
            col += vec3(0.2, 0.4, 0.8) * spec * 0.5;
        } else if(res.y == 1.0) { // Portal Frame
            col = vec3(1.0, 0.6, 0.2) * 2.0;
        } else if(res.y == 2.0) { // Portal Interior
            float pulse = sin(iTime * 3.0) * 0.5 + 0.5;
            col = vec3(0.1, 0.5, 1.0) * (diff + spec + 0.5);
            col += vec3(0.5, 0.8, 1.0) * pulse * 0.5;
        }

        // Fog
        float fog = 1.0 - exp(-dO * u_mist_density);
        col = mix(col, sky, fog);
    }

    // 4. Post Processing & Bloom
    // Add the orange portal glow
    vec3 glowCol = vec3(1.0, 0.4, 0.1) * glow * u_portal_glow * 0.1;
    col += glowCol;

    // Interior "Alpha Blue" bloom
    float diskDist = length(p.xy - vec2(0.0, 0.5)) - u_portal_size;
    if (diskDist < 1.0) {
        float interiorGlow = smoothstep(1.0, -1.0, diskDist);
        col += vec3(0.0, 0.3, 0.8) * interiorGlow * 0.2;
    }

    // Contrast and Gamma
    col = pow(col, vec3(0.8));
    col *= 1.2;

    fragColor = vec4(col, 1.0);
}
